DozoR City – is the app for public transport monitoring and forecasting its arrival time.

This application will be useful to all users of public transport in next of Ukrainian cities: Avdiivka, Bila Tserkva, Boryslav, Brovary, Drohobych, Dubno, Zhytomyr, Zaporizhzhya, Ivano-Frankivsk, Kamyanets-Podilsky, Kamyanske, Kovel, Kolomyia, Korosten, Kostiantynivka, Kramatorsk, Kropyvnytskyi, Lviv, Myrhorod, Mukachevo, Nova Kakhovka, Novovolynsk, Pokrovsk, Exactly, Uzhhorod, Khmelnytsky, Cherkasy, Chernihiv, Chortkiv.

Transport data is available online through the GPS navigation system.

The program is able to:

- display on a map where your trolleybus or bus is now and show the direction of its movement;

- determine the actual time of arrival of public transport for each stop;

- display on the map a complete list of urban transport routes, such as public trolleybuses and private buses;

- show transport adapted for people with reduced mobility;

- display your location using GPS, so you can find the nearest stop.
